const swiper=new Swiper(".swiper",{pagination:{el:".swiper-pagination",clickable:!0},grabCursor:!0,initialSlide:2,autoplay:{delay:2e3},loop:!0,speed:700,effect:"cube",cubeEffect:{shadow:!1}}),dots=document.querySelectorAll(".swiper-pagination-bullet"),activeDot=document.querySelector(".swiper-pagination-bullet-active"),activeNum=activeDot.getAttribute("aria-label")[activeDot.getAttribute("aria-label").length-1];for(let e=0;e<activeNum;e++)dots[e].classList.add("swiper-pagination-bullet-white");swiper.on("slideChange",(function(){const e=document.querySelector(".swiper-pagination-bullet-active"),t=e.getAttribute("aria-label")[e.getAttribute("aria-label").length-1];for(let e=0;e<t;e++)dots[e].classList.add("swiper-pagination-bullet-white");for(let e=t;e<6;e++)dots[e].classList.remove("swiper-pagination-bullet-white")}));